import React from "react";
import "./styles/Contracts.css";

const ContractData = props => {

  return (
    <React.Fragment>
      <p>Name: {props.contracts[0]} </p>
      <p>Start: </p>
      <p>Ende: </p>
      <p>Preis: </p>
      <p>Beschreibung: </p>
    </React.Fragment>
  );
};

const Contract = props => (
  <div className="contractBox">
    <ContractData contracts={props.contracts}></ContractData>
  </div>
);

export default Contract;
